import React from 'react';
import Card from "./Card" 
import Sdata from "./Sdata"
import "./DarkMode.css"
import DarkMode from './DarkMode'

const App = () => {
  

  return (
    <>
        <DarkMode/>
       
        <h1 className="heading_style">Most Watched Netflix Webseries</h1>
        
        {Sdata.map((val) => (
          <Card 
            key={val.id}
            imgsrc={val.imgsrc}
            title={val.title}
            sname={val.sname}
            link={val.link} 
          /> 
        ))}
      
    </>
  );
};

export default App;
